With fully secured bio-metric based authentication, the simple and intuitive app offers you peace of mind for your everyday banking activity. It is designed to offer a multitude of functions, from balance inquiry, bill payments to quick transactions. 

Using the BNF Mobile App you can: 
•	keep an eye out and take control of your finances;
•	swiftly view account balances and transactions;
•	transfer money securely between own accounts;
•	make quick payments, pay utility bills and much more;
•	send a secure message to our Customer Care team; and
•	log on a unique security device with your fingerprint or password ID.
Simple and Secure, more control for you!

Инструмент для управления финансами вашей организации «Уралсиб Бизнес».
Один раз пройдите авторизацию и просматривайте информацию без логина и пароля. Подтверждение понадобится для всех финансовых операций.

Возможности:
- Создание платежей в рублях и иностранной валюте из шаблона платежа/контрагента и по классической форме;
- Обмен валют;
- Обмен документами с Банком в разделе «Валютный контроль»;
- Управление корпоративными картами: установка лимитов, блокировка и закрытие;
- Просмотр актуальных остатков по расчетным счетам, счетам корпоративных карт, информации по депозитам, кредитам и корпоративным картам;
- Переключение между организациями для мультиклиентов двумя кликами;
- Обзор и поиск информации в ленте операций по фильтрам;
- История заявок с детализацией;
- Онлайн-консультант (Чат) с Банком;
- Повторить ранее сделанный платёж из истории операций;
- Направить подтверждение об оплате по e-mail или номеру телефона;
- Возможность выпустить Бизнес, Виртуальную и Премиальную карты ;
- Заказ справок;
- Импорт платежных документов из 1С;
- Управление услугой «СМС-информирование»;
- Выписка по счёту и по Бизнес картам;
- Формирование платежного поручения по QR - коду;
- Заказ наличных средств через «Кассовая заявка на выдачу средств» и «Электронный чек»;
- Распределение средств с транзитного счёта, отражение суммы в разделе валютного счёта;
- SMS-сервис по бизнес-картам.

